import React from 'react';
import Header from '../Header/Index';
import Table from './Table';
import { Row, Col } from 'antd';
const Index = (props) => {
    return (
        <div className="row">
        <div className="col-xl-2"><MenuBar /></div>
        <div className="col-xl-10">
          <HeaderTop />
          <Table />
        </div>
      </div>
    );
}
export default Index;
